import React from "react";
import { Link } from "react-router-dom";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import "../../page.css";

class ListEquipe extends React.Component {
  constructor() {
    super();
    this.state = {
      data: [],
      emp: []
    };
  }

  fetchData() {
    fetch('http://127.0.0.1:8000/team/')
      .then(response => response.json())
      .then((data) => {
        this.setState({
          data: data,
        });
      });
  }


  

  componentDidMount() {
    this.fetchData();
    this.fetchDataEmp(); // Fetch employee data when the component mounts
  }

  deleteEquipe(id) {
    fetch('http://127.0.0.1:8000/team/' + id + '/', {
      method: 'DELETE',
    })
      .then(response => response)
      .then(() => {
        this.fetchData();
      });
  }

    // Add this function to fetch employee data
    fetchDataEmp() {
        fetch('http://127.0.0.1:8000/employee/')
          .then((response) => response.json())
          .then((data) => {
            
            this.setState({ emp: data }, 
            );
          });
      }
      //*********************** */

  render() {
 // Assuming employees is an array of employees and listdata is an array of squads

const employees = this.state.emp;
const listdata = this.state.data;

// Create a map of employee IDs to their squads
const employeeSquads = {};

listdata.forEach((sqd) => {
  if (employeeSquads[sqd.emp_eq]) {
    employeeSquads[sqd.emp_eq].push(sqd);
  } else {
    employeeSquads[sqd.emp_eq] = [sqd];
  }
});

const rows = employees.map((emp) => (
  <tr key={emp.id}>
    <th scope="row">{emp.id}</th>
    <td>{emp.nomComplet}</td>
    <td>
      {employeeSquads[emp.id] ? (
        <ul>
          {employeeSquads[emp.id].map((sqd) => (
            <li key={sqd.id_eq}>
              <Link to={'/update_équipe/' + sqd.id_eq}>{sqd.nom_eq}</Link>
            </li>
          ))}
        </ul>
      ) : (
        'Aucune équipe'
      )}
    </td>
    <td>Autres informations de l'employé si nécessaire</td>
    <td>Autres informations de l'employé si nécessaire</td>
    <td>Autres informations de l'employé si nécessaire</td>
    <td>
      {/* You can add buttons or actions related to employees here */}
      <Link to={'/modifier_employé/' + emp.id} className="btn btn-info">
        Modifier
      </Link>
    </td>
  </tr>
));


    return (
      <div>
        <Header />
        <div id='page'>
          <Link className="nav-link" style={{ paddingLeft: '1340px' }} to="/add_équipe">
            <span className="btn btn-success" style={{ fontSize: '27px' }}>Ajouter</span>
          </Link>
          <table className="table table-striped table-bordered text-center">
            <thead>
              <tr>
                <th scope="row">Equipe No</th>
                <th> Nom équipe </th>
                <th> Responsable </th>
                <th> Date du création </th>
                <th> Projet en Cours </th>
                <th> Employées </th>
                <th> Actions </th>
              </tr>
            </thead>
            <tbody>
              



            {rows}





            </tbody>
          </table>
        </div>
        <Footer />
      </div>
    );
  }
}

export default ListEquipe;
